require("../src/unittype");
var unit = require("../src/unit.json");

// var keys = Object.keys(unit);
// var unitkey = Object.keys(unit[keys[0]]);
// var unitss = Object.keys(unit.unitvalue()[1][keys[1]])

class secoundInput extends Component {
  constructor(props) {
    super(props);
  }

  keys = Object.keys(unit);
  unitkey = Object.keys(unit[keys[this.props.unit]]);

  //  Type = this.props.unit

  // keys = Object.keys(unit.unitvalue()[0])
