  // for (var i=0; i< keys.length; i++){
  //   if(this.props.unit == 1){

  //   }
  // }

  render() {
    return (
      <div>
        <label htmlFor="fname">Enter Value :</label>
        <input
          type="text"
          id="output"
          // onChange={this.changeFirstInput}
          // value={this.state.firstInput}
        />

        <select id="secoundUnit">
          <option value="N/A">{this.setunit}Select Unit</option>

          <option value="FEET">
            {unit[keys[this.props.unit]][unitkey[0]]}
          </option>
          <option value="INCH">
            {unit[keys[this.props.unit]][unitkey[1]]}
          </option>
          <option value="YARD">
            {unit[keys[this.props.unit]][unitkey[2]]}
          </option>
          <option value="CM">{unit[keys[this.props.unit]][unitkey[3]]}</option>
        </select>
      </div>
    );
  }
}

export default secoundInput;
